import {Card, Col, Container, Row} from 'react-bootstrap';
class Bienvenue extends React.Component {
    render() {
        return (

            <Container>
                <Row>
                    <Col lg={12} style = {marginTop} >

                        <Card className="bg-dark text-white">
                            <h1>Hello World!</h1>
                            <p>
                                Ceci est le corps de la page.
                            </p>
                        </Card>
                    </Col>
                </Row>
            </Container>
        ); } }
export default Bienvenue;
